import React from 'react';

import './VendorForm.css';

const VendorForm = () => {
    return(
    <form >
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>title</label>
          <input type="text" />
        </div>
        <div className="new-expense__control">
          <label>Amount</label>
          <input type="text"/>
        </div>
        <div className="new-expense__control">
          <label>Date</label>
          <input type="date" min="2019-01-01" max="2022-12-31"   />
        </div>
      </div>

    </form>
    );
};

export default VendorForm;
